import React, { useState } from 'react';

export default function (){
  const [mode, setMode] = useState(false);

  function onClickHandler(){
    setMode(true);
  }

  return (
    <div>
      <button onClick={onClickHandler}>Show SideBar</button>
    </div>
  );
}
